import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './Components/Header.js';
import Menu from './Components/Menu.js';
import Seccion from './Components/Seccion.js';
import Footer from './Components/Footer.js';
import './App.css';

const App = () => {
  return (
    <Router>
      <Header /> {/* El encabezado y menú */}
      <main>
        <Routes>
          <Route path="/" element={<Seccion titulo="Bienvenido a Autos 360" contenido="Aquí encontrarás los mejores autos." />} />
          <Route path="/autos" element={<Seccion titulo="Nuestros Autos" contenido="Explora nuestra gama de autos nuevos y usados." />} />
          <Route path="/contacto" element={<SeccionContacto />} />
        </Routes>
      </main>
      <Footer /> {/* El pie de página */}
    </Router>
  );
}

// Nuevo componente para la sección de contacto
const SeccionContacto = () => {
  const [email, setEmail] = React.useState('');
  const [phone, setPhone] = React.useState('');

  const handleSubmit = (event) => {
    event.preventDefault();
    alert(`Correo: ${email}, Teléfono: ${phone}`);
    // Aquí podrías enviar los datos a un servidor si lo deseas
  };

  return (
    <div>
      <h2>Contacto</h2>
      <p>Por favor, ingresa tu información de contacto:</p>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Email:</label>
          <input 
            type="email" 
            value={email} 
            onChange={(e) => setEmail(e.target.value)} 
            required 
          />
        </div>
        <div>
          <label>Teléfono:</label>
          <input 
            type="tel" 
            value={phone} 
            onChange={(e) => setPhone(e.target.value)} 
            required 
          />
        </div>
        <button type="submit">Enviar</button>
      </form>
    </div>
  );
}

export default App;
